        if start >= end:
            return []
        else:
            subseq = []
            while start < end:
                subseq.append(a[start])
                start += 1
            return subseq

    def find_max_length_subsequence(start, end):
        max_length = 1
        current_subsequence = []
        for i in range(start, end + 1):
            new_subsequence = find_subsequence(start, i)
            if len(new_subsequence) > max_length:
                max_length = len(new_subsequence)
                current_subsequence = new_subsequence
            elif len(new_subsequence) == max_length:
                current_subsequence.extend(new_subsequence)
        return current_subsequence

    max_length = find_max_length_subsequence(0, len(a))
    sequence = find_max_length_subsequence(0, n - 1)

    return str(max_length) + '\n' + str(sequence)

