            if line.startswith(opening_delimiter):
                opening_delimiter_index = line.index(opening_delimiter)
                opening_delimiter_type = line[opening_delimiter_index - 1]
                closing_delimiter_type = line[closing_delimiter_index + 1]

                if closing_delimiter_type not in closing_delimiters:
                    return f'opening delimiter is not closed by {opening_delimiter}'

                closing_delimiter_index = line.index(closing_delimiter_type, opening_delimiter_index + 1)
